COSBase base = acquireItem( j );
if( base instanceof COSNumber )
{
    COSNumber number = (COSNumber)base;
    result[j] = number.floatValue();
}

COSBase cosObj = acquireItem(j);
if (cosObj instanceof COSNumber)
{
    COSNumber cosNumber = (COSNumber)cosObj;
    result[j] = cosNumber.floatContent();
}

COSBase cosBase = acquireItem( j );
if (cosBase instanceof COSNumber)
{
    COSNumber cosNumber = (COSNumber)cosBase;
    result[j] = cosNumber.floatContent();
}

COSBase cosBase = acquireItem( j );
if( cosBase instanceof COSInteger )
{
    result[j] = (float)((COSInteger)cosBase).longValue();
}
else if( cosBase instanceof COSFloat )
{
    result[j] = ((COSFloat)cosBase).floatValue();
}
else
{
    throw new RuntimeException( "Error: Unknown COSBase derived type:" + cosBase );
}

